import img from "../../images/hcs.png"
import getHcsLink from "../dataRetrieval/getHcsLink";

export default function FocusedTitle({style, setFocused, focusedItem, locationHierarchy}) {
  return (
    <div style={style.focusedMainTitleContainer}>
      <a 
          href={getHcsLink(focusedItem, locationHierarchy)} 
          target="_blank" 
          rel="noreferrer" 
          style={{width: "100%"}}>
        <img src={img} alt="" style={style.focusedHcsImage}></img>  
      </a>

      <div style={style.focusedMainTitle}>{focusedItem.profile}</div>

      <div style={style.closeContainer}>
        <div onClick={() => {setFocused([])}} style={style.focusedClose}>+</div>
      </div>
    </div>
  )
}
